import { useSelector, useDispatch } from 'react-redux';
import { useState } from 'react';
import React from 'react';

export const Cal1 = (props) => {
    const val = props.val
    const dist = props.dist

    const add = () => {
        props.val = val + dist
        return props.val;
    }
    const sub = () => {
        props.val = val + dist
        return props.val
    }
    return (
        <div>
            <h1>{val}</h1>
            <h1><button type="button" onClick={add}>- {dist}</button>            
            </h1>

            <h1><button type="button" onClick={sub}>+ {dist}</button>
            </h1>
        </div>
    );
};
